  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:50.147602\",\n\t\"name\": \"willamette-valley-baskett-butte-oak-savannah-restoration-phase-2\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a follow-up to the 2010
  project that removed three invasive tree species across 85 acres on Baskett Butte
  at Baskett Slough NWR. Lack of fire in the understory has allowed invasive plant
  species to encroach and decrease historic native Oregon white oak/prairie habitat
  on Baskett Butte. The current project focused on approximately 50 acres that is
  within/adjacent to the 2010 treatment area by targeting and removing Douglas fir
  seedlings, Himalayan blackberry, poison oak, and tall oatgrass. Removal and treatment
  of these invasives will ensure the continuation of the historic savannah grassland.
  Stump grinding/slash piling burning is required prior to mechanical mowing treatments.
  Full sunlight exposure on the restoration site should result in eliminating shiny
  geranium, an invasive forest forb, from the site because it is sensitive to direct
  sunlight. Native upland prairie seed will be planted in open and disturbed ground
  as well as followed up by herbicide treatment of invasive woody vegetation and tall
  oatgrass when needed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
